CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_APP_CONSULTA_MODULOS_SISTEMA`(IN `id_sistemap` INTEGER)
begin
  
  select * from pv_cat_sistema_modulo as sm
      join pv_cat_modulos as m on(m.id = sm.id_modulo)
    where sm.id_sistema = id_sistemap and sm.status = 1 and m.status = 1;
end ;;
