CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_APP_MENU_FN_CONSULTA_MENUBARAPP`(IN `paSoloActivos` INTEGER, IN `id_sistemap` INTEGER)
begin

  declare vlsql text;
  set vlsql := 'select idmenu, orden, texto, tooltip, icono, esactivo, fechareg, fechamod, idusrreg, idusrreg from menu_tmenubarapp ';
  if paSoloActivos = 1 then
    set vlsql := vlsql || '   where esactivo = 1 ';
  end if;
  if id_sistemap > 0 then
    set vlsql := vlsql || '   and id_sistema =  ' || id_sistemap;
  end if;
  set vlsql := vlsql || ' order by orden asc, idmenu asc ';
  
  execute vlsql;
  
end ;;
