CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_T3BLOGIN_LOGIN`(IN `usuario` VARCHAR(50), IN `contra` VARCHAR(50), OUT `res` INTEGER, OUT `msg` VARCHAR(120))
begin
  declare vlexiste integer;
  set msg = 'usuario no valido';
  select id_usr into vlexiste from pv_cat_user where login_usr = usuario and passwd = f_password(contra);
  set res = vlexiste;
  if vlexiste = 1 then 
	set msg := 'usuario valido';
  end if;
end ;;
