CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_T3BLOGIN_PERMISOPERFIL`(IN `id_perfilp` INTEGER, IN `id_sistemap` INTEGER)
begin
  
  select * from pv_cat_prm_prf as pp
      join pv_cat_permiso as p on(p.id_permiso = pp.id_permiso)
      join pv_cat_acciones_modulo as am on(am.id = p.id_accion_modulo)
    where pp.id_perfil = id_perfilp
    and pp.status = 1
    and p.estatus = 1
    and am.status = 1
    and p.id_sistema = id_sistemap;
end ;;
