CREATE DEFINER=`pv`@`%` PROCEDURE `SP_T3BVENTA_ABRIR_VENTA`()
BEGIN

      DECLARE ticket INT;
      DECLARE id_ INT;
      
      SELECT MAX(num_ticket) FROM pv_t3bventa_movimientos_enc WHERE DATE(atmfecha)=DATE(SYSDATE()) INTO ticket;

      IF ticket IS NULL
      THEN
            SET ticket=1;
      ELSE
            SET ticket=ticket+1;
      END IF;

      INSERT INTO pv_t3bventa_movimientos_enc 
        (id,id_tienda,num_ticket,id_pv,atmfecha,atmdesc,importe_total,importe_iva,importe_ieps,user_id,ve_clave,estatus,termino)
        VALUES
        (NULL,0, ticket, 0, SYSDATE(),'',0,0,0,0,0,0,0);
 
     select MAX(id) as id,max(num_ticket) as num_ticket from pv_t3bventa_movimientos_enc WHERE DATE(atmfecha)=DATE(SYSDATE());
END ;;
