CREATE DEFINER=`pv`@`` PROCEDURE `SP_T3BVENTA_BUSCA_PRODUCTO_REL`(IN codigo VARCHAR(20))
BEGIN

        DECLARE iclave_mc_tmp INT;
        DECLARE iclave_mp_tmp INT;
        DECLARE diferencia DECIMAL(15,4);
        DECLARE factor INT;


        SELECT id_prod_mc,id_prod_mp INTO iclave_mc_tmp,iclave_mp_tmp FROM pv_cat_rel_mp_mc WHERE icb_mc=codigo limit 0,1;
        SELECT (select precio_venta from pv_cat_producto where id_prod=iclave_mc_tmp and codigo_barras=codigo limit 0,1)
        -(select precio_venta from pv_cat_producto where id_prod=iclave_mp_tmp limit 0,1) INTO diferencia;

        IF diferencia is null then


            set diferencia:=0;
        
        end if;

        
        

    
        SELECT id_prod_mp,descripcion,desc_corta_mp,desc_corta_mc,path_imagen,abs(diferencia) as diferencia  FROM pv_cat_rel_mp_mc WHERE icb_mc=codigo limit 0,1;

    



END ;;
