CREATE DEFINER=`pv`@`%` PROCEDURE `SP_T3BVENTA_INSERTA_ARTICULO`(IN ticket INT, IN codigo VARCHAR(20),IN caja VARCHAR(5),
				     IN cantidad DECIMAL(15,4),IN userid INT,IN art_iclave INT ,
					IN art_pclave INT,IN art_iv_clave DECIMAL(15,4),IN art_ie_clave DECIMAL(15,4),IN venta decimal(15,4))
BEGIN
	
	DECLARE art_itype INT;

	SELECT itype INTO art_itype FROM pv_cat_producto WHERE codigo_barras = codigo;

	SET venta = venta * cantidad;

	INSERT INTO pv_t3bventa_movimientos_det_tmp 
        (id_tienda,num_ticket,id_prod,icb,id_pv,id_prov,atmfecha,atmdesc,atmcant,atmcosto,
                                    atmventa,iv_monto,ie_monto,user_id,estatus,enc_id)
	VALUES 
        (0, ticket, art_iclave, trim(codigo), caja, art_pclave, SYSDATE(), "VT",cantidad, 0, 
                                    venta, art_iv_clave, art_ie_clave, userid, 0,0);

	if (art_itype=8) then  
   
      		insert into pv_t3bventa_articulos_puntos
            (id_tienda,id_prod,codigo_barras,atmventa,num_ticket,id_pv,fecha)
            values
            (0,art_iclave,trim(codigo),venta,ticket,caja,now());

	end if;

END ;;
DELIMITER ;
